import {Component, react} from 'react'  
import Axios from 'axios';  
const [product, setProduct] = react([]);  
react.useEffect(()=>{
    const loadProduct = async() => {
        const repsonse = await Axios.get("http://localhost:4000/product");
        setProduct(repsonse.data.result.MaHang);
    }
    loadProduct();
}, []);
class printRootProduct extends Component {    
    render() {
        return (
            <div id="listProduct">      
                {product.map((p) => 
                    <div id={"G" + p}></div>
                )}        
            </div>
        );
    }
}

export default printRootProduct;
